import React, { PureComponent } from 'react'

//styled
import Outer from './styled/Outer'

//components
import FancyTitleInput from '../../../../../FancyTitleInput'

export default class PriceRow extends PureComponent{
    constructor(props){
        super(props)
        this.state = {}
    }

    handleChange = (e) =>{
        this.props.handleChange(e);
    }

    render(){
        return(
            <Outer>
                <div className="cell">
                    <FancyTitleInput placeholder={"Shares Bought"} handleChange={this.handleChange}/>
                </div>
                <div className="cell">
                    <FancyTitleInput placeholder={"Purchased Price"} handleChange={this.handleChange}/>
                </div>
            </Outer>
        )
    }
}
